css:
/*粉换蓝*/
@-moz-document domain("bangumi.tv"),domain("bgm.tv"),domain("chii.in"){

/*右侧粉红头部不要了*/
#headerNeue{line-height:100%;height:50px;background:transparent !important;}

/*左侧方块背景*/
#wrapper{background:transparent url('data:image/png;base64,') repeat-x !important;}

/*搜索栏边框*/
#headerSearch{border:1px solid #A7D0F0 !important;}

/*用户名左边LOGO的竖条去除*/
#headerNeue a.logo{background:url('data:image/png;base64,') no-repeat !important;}

}
